import React from 'react';
import '../Hero/Hero.scss';
import HeroVideo from '../../assets/video/BrainStation-Sample-Video.mp4';
import HeroPlay from '../../assets/icons/Icon-play.svg';
import HeroFullscreen from '../../assets/icons/Icon-fullscreen.svg';
import HeroVolume from '../../assets/icons/Icon-volume.svg';
import VideoImg0 from '../../assets/images/video-list-0.jpg'; 


function Hero(props) {
  return (
    <section className="Hero">
     
      <div className="Hero__controlers">
        <div className="Hero__play">
        <img className="Hero__playImg" src={HeroPlay} />
        </div>
        <div className="Hero__slider"></div>
        <div className="Hero__fullscreen">
        <img className="" src={HeroFullscreen} />
        <img className="" src={HeroVolume} />
        </div>

      </div>

      <video className="Hero__video" poster={VideoImg0} source src={HeroVideo} type="video/mp4"> </video>


    </section>
  );
}

export default Hero;
